import React, { Component } from 'react';
import "./Messages.css";

export default class Messages extends Component {
    render() {
        return (
            <section id="sermon" className="sermon">
              <div className="container">
                <div className="section-title" data-aos="fade-up">
                  <h2 data-aos="fade-down">Sermon</h2>
                </div>

                <div>
                <audio controls preload="metadata">
                  <source src="assets/heirs-of-salvation.mp3" type="audio/mpeg"/>
                Your browser does not support the <code>audio</code>element.
                <a href="assets/heirs-of-salvation.mp3" className="btn btn-primary">Download</a>
                </audio>
                   <h3>Heirs Of Salvation</h3>
                   <p>Minister: |<strong>Femi Lawal</strong></p>
                   <p>Date: April 2, 2020</p>
                 </div>

              </div>
            </section>
        )
    }
}
